import React from 'react';
import './item-filter.css';

const ItemFilter = ({ done }) => {

    render()
    return(
        <div className ='item-filter'>
        
                <h3>{ done } items left</h3>
                   
                        <div className ='btn-group'>
                            <button className = 'btn btn-outline-dark'>All</button>
                            <button className = 'btn btn-outline-dark'>Active</button>
                            <button className = 'btn btn-outline-dark'>Complete</button>            
                        </div>
    
                <button type = 'button' className = 'btn btn-outline-dark'>Clear completed</button>
            
        </div>
    )
};

export default ItemFilter;
